@app.on_message(filters.command("gule", prefixes=".") & filters.me)
def gule(app, message):
    app.send_message(message.chat.id,f'<b>1000-7=?</b>')
    sleep(4)
    i = 1000
    while i > 0:
        try:
            app.send_message(message.chat.id, f'{i} - 7 = {i-7}')
        except FloodWait as e:
            sleep(e.x)

        i -= 7
        sleep(0)


